(19, 13, 'Normal', 'Aspicot', 'Weedle', 'Pokémon Insectopic', 'Insecte', 'Poison', '1′00″', '7.1 lbs', 'Écran Poudre', '', 'Fuite', 40, 35, 30, 20, 20, 50, 195, 190, 67, 58, 40, 40, 94, 284, 185, 174, 152, 152, 218, 'L\'odorat d\'Aspicot est extrêmement développé. Il lui suffit de renifler ses feuilles préférées avec son gros appendice nasal pour les reconnaître entre mille.', );
