(20, 14, 'Normal', 'Coconfort', 'Kakuna', 'Pokémon Cocon', 'Insecte', 'Poison', '2′00″', '22.0 lbs', 'Mue', '', '', 45, 25, 50, 25, 25, 35, 205, 200, 49, 94, 49, 49, 67, 294, 163, 218, 163, 163, 185, 'Coconfort est la plupart du temps immobile et reste accroché à un arbre. Cependant, intérieurement, il est très actif, car il se prépare pour sa prochaine évolution. En touchant sa carapace, on peut sentir sa chaleur.', );
