(23, 16, 'Normal', 'Roucool', 'Pidgey', 'Pokémon Minoiseau', 'Normal', 'Vol', '1′00″', '4.0 lbs', 'Regard Vif', 'Pieds Confus', 'Cœur de Coq', 40, 45, 40, 35, 35, 56, 251, 190, 85, 76, 67, 67, 105, 284, 207, 196, 185, 185, 232, 'Roucool a un excellent sens de l\'orientation. Il est capable de retrouver son nid sans jamais se tromper, même s\'il est très loin de chez lui et dans un environnement qu\'il ne connaît pas.', );
